import React from 'react'
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
} from 'react-router-dom'
import classes from './MenuHome.module.css'

const MenuHome = () => {
  const handleClick = () => {
    console.log('Clicked !!!')
  }
  function Home() {
    return (

      <h2>Home</h2>
    )
  }

  function Account() {
    return <h2>Account</h2>
  }
  function Courses() {
    return <h2>Courses</h2>
  }
  function Teacher() {
    return <h2>Teacher</h2>
  }
  const listMenu = [
    {
      id: 1,
      title: 'Home',
      link: '/',
    },
    {
      id: 2,
      title: 'Courses',
      link: '/courses',
    },
    {
      id: 3,
      title: 'Become a teacher',
      link: '/becomeateacher',

    },
    {
      id: 4,
      title: 'Account',
      link: '/account',
    },
  ]
  return (
    <Router>
      <div className={classes.AppHeaderMenu}>
        <div>
          <nav>
            <ul className={classes.AppHeaderMenuItem}>
              {listMenu.map((item) => <li key={item.id}>
                <Link
                  onClick={handleClick}
                  to={item.link}
                >
                  {item.title}
                </Link>
              </li>)}
            </ul>
          </nav>
        </div>
        <Switch>
          <Route path="/courses" component={Courses} />
          <Route path="/becomeateacher" component={Teacher} />
          <Route path="/account" component={Account} />
          <Route path="/" component={Home} />
        </Switch>
      </div>
    </Router>
  )
}
export default MenuHome
